import React from 'react'
import './Form.scss'
const Form = () => {
	function checkLink(e){
		if(e.target.value===""){
			return true
		}
	}
	return (
		<form>
			<input onBlur={(e)=>checkLink(e)} type="text" placeholder="Shorten a link here..."/>
			{checkLink?"":"aaaa"}
			<button>Shorten It!</button>
		</form>
	)
}

export default Form
